var title_f18_13_18651="Mechanisms benefit exercise";
var content_f18_13_18651=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F50956&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F50956&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Biological mechanisms for benefit of exercise",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Antiatherogenic effects",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Reduction of adiposity, particularly in those with excess upper body and abdominal fat",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Reduction of elevated blood pressure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Reduction of elevated plasma triglycerides (and associated small dense LDL particles)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Increase in HDL cholesterol levels",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Improvement in insulin sensitivity and glucose use and reduction in risk of type 2 diabetes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Antithrombotic effects",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Endothelial function alteration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Autonomic functional changes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anti-ischemic effects",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Antiarrhythmic effects",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Fletcher GF, Balady GJ, Amsterdam EA, et al. Circulation 2001; 104:1694.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
